B.Y_=new A.T(B.yL,["Cross-Platform Developer","I build functional, efficient, and user-focused systems, and I\u2019m passionate about what I do.","Optional","Mijael Viricochea","I am a cross-platform developer with expertise in Dart, Python, SQL, and tools like Flutter, Django, Docker, and PostgreSQL. Specializing in business systems development, user-centered design, and scalable architectures, I focus on creating efficient, impactful software solutions. With a passion for problem-solving and optimization, I am continuously learning and currently deepening my knowledge in advanced Flutter, DevOps, and system scalability to stay at the forefront of technology.\n\nCurrently, I am focused on developing production-ready systems, constantly refining my skills to deliver robust and impactful software. My work prioritizes both technical precision and real-world usability, ensuring that each project meets the needs of its users.\n\nIn the past, I\u2019ve had the chance to explore various aspects of software development, tackling challenges across different domains. From building full-fledged business systems to refining tools for better operational management, each project has been an exciting opportunity to learn and grow.\n\nWhen I\u2019m not coding, you\u2019ll find me exploring new technologies, diving into creative hobbies, or strategizing my way through epic battles in search of rare materia.","About","Projects","E-Tech","A comprehensive system designed to streamline inventory management and point-of-sale (POS) operations. Topics covered include inventory tracking, sales processing, reporting features, multi-user access, and integration with external services. Technologies used include Django, PostgreSQL, React, and Docker.","Clinicaut: Dental Clinic Management System","A specialized system designed to optimize operations in dental clinics. Features include patient management, appointment scheduling, billing, reporting, and the ability to store detailed medical histories.","Login","Secure authentication system that allows users to log in with their credentials, ensuring authorized access to the platform.","Appointments","Overview of scheduled appointments with filtering and management options to optimize clinic workflow.","Schedule an Appointment","Intuitive interface for booking new appointments, selecting available slots, and assigning patients.","Register a New Patient","Simple form to add a new patient to the system, capturing essential personal and medical details.","Patient Detail","Comprehensive patient profile with contact details, medical history, and past appointments.","Add Medical History","Feature to document a patient\u2019s medical history, including conditions, allergies, and previous treatments.","Medical History Detail","Detailed view of a patient\u2019s recorded medical history with chronological entries.","Treatment Plan Detail","Breakdown of a patient\u2019s ongoing or planned treatments, including procedures, costs, and progress tracking.","Payments","Interface for managing patient payments, tracking transactions, and generating receipts.","Accounting","Financial dashboard with income tracking, expense management, and billing insights for clinic administrators.","Inventory","Comprehensive inventory management to track products, stock levels, and item details across multiple branches.","Product Detail","Detailed view of individual products, including pricing, stock availability, and sales history.","Store Management","Tools to manage multiple stores, monitor performance, and oversee operations seamlessly.","Add Personnel","Easily register new staff members and manage their roles, permissions, and access levels.","Add Branch","Expand operations by adding new branches with customizable settings and location details.","Access History","Track user access and activity logs to ensure security and monitor personnel actions.","Make a Sale","Streamlined sales process for quick and efficient transactions with real-time inventory updates."],t.yf)
B.Y0=new A.T(B.yL,["Desarrollador Multiplataforma","Dise\xf1o y desarrollo sistemas funcionales, eficientes y orientados al usuario, con una gran pasi\xf3n por mi trabajo.","Opcional","Mijael Viricochea","Soy un desarrollador multiplataforma con experiencia en Dart, Python, SQL y herramientas como Flutter, Django, Docker y PostgreSQL.\n\nMe enfoco en el desarrollo de sistemas empresariales, dise\xf1o centrado en el usuario y arquitecturas escalables, buscando soluciones de software eficientes e impactantes.\n\nMi pasi\xf3n por la resoluci\xf3n de problemas y la optimizaci\xf3n me impulsa a aprender continuamente, especialmente en Flutter avanzado, DevOps y escalabilidad de sistemas.\n\nActualmente, me dedico a crear sistemas listos para producci\xf3n, priorizando la precisi\xf3n t\xe9cnica y la usabilidad. He enfrentado diversos desaf\xedos en el desarrollo de software, cada uno como una oportunidad de aprendizaje y crecimiento.\n\nCuando no estoy programando, disfruto aprendiendo nuevas tecnolog\xedas, pasatiempos creativos o trazando estrategias para conseguir materia rara en FF VII.","Acerca de","Proyectos","E-Tech","Un sistema integral dise\xf1ado para optimizar la gesti\xf3n de inventarios y las operaciones de punto de venta (POS). Los temas cubiertos incluyen seguimiento de inventarios, procesamiento de ventas, funciones de informes, acceso multiusuario e integraci\xf3n con servicios externos. Las tecnolog\xedas utilizadas incluyen Django, PostgreSQL, React y Docker.","Clinicaut: Sistema de Gesti\xf3n de Cl\xednicas Dentales","Un sistema especializado dise\xf1ado para optimizar las operaciones en cl\xednicas dentales. Las caracter\xedsticas incluyen gesti\xf3n de pacientes, programaci\xf3n de citas, facturaci\xf3n, informes y la capacidad de almacenar historiales m\xe9dicos detallados.","Iniciar Sesi\xf3n","Sistema de autenticaci\xf3n segura que permite a los usuarios iniciar sesi\xf3n con sus credenciales, asegurando el acceso autorizado a la plataforma.","Citas","Visi\xf3n general de las citas programadas con opciones de filtrado y gesti\xf3n para optimizar el flujo de trabajo de la cl\xednica.","Programar una Cita","Interfaz intuitiva para reservar nuevas citas, seleccionando espacios disponibles y asignando pacientes.","Registrar un Nuevo Paciente","Formulario simple para agregar un nuevo paciente al sistema, capturando detalles personales y m\xe9dicos esenciales.","Detalle del Paciente","Perfil completo del paciente con detalles de contacto, historial m\xe9dico y citas pasadas.","Agregar Historial M\xe9dico","Funci\xf3n para documentar el historial m\xe9dico de un paciente, incluyendo condiciones, alergias y tratamientos previos.","Detalle del Historial M\xe9dico","Vista detallada del historial m\xe9dico registrado de un paciente con entradas cronol\xf3gicas.","Detalle del Plan de Tratamiento","Desglose de los tratamientos en curso o planificados de un paciente, incluyendo procedimientos, costos y seguimiento del progreso.","Pagos","Interfaz para gestionar los pagos de los pacientes, rastrear transacciones y generar recibos.","Contabilidad","Panel financiero con seguimiento de ingresos, gesti\xf3n de gastos y an\xe1lisis de facturaci\xf3n para los administradores de la cl\xednica.","Inventario","Gesti\xf3n integral de inventarios para rastrear productos, niveles de stock y detalles de art\xedculos en m\xfaltiples sucursales.","Detalle del Producto","Vista detallada de productos individuales, incluyendo precios, disponibilidad de stock e historial de ventas.","Gesti\xf3n de Tiendas","Herramientas para gestionar m\xfaltiples tiendas, monitorear el rendimiento y supervisar las operaciones sin problemas.","Agregar Personal","Registrar f\xe1cilmente nuevos miembros del personal y gestionar sus roles, permisos y niveles de acceso.","Agregar Sucursal","Expandir operaciones agregando nuevas sucursales con configuraciones personalizables y detalles de ubicaci\xf3n.","Historial de Acceso","Rastrear el acceso de usuarios y los registros de actividad para asegurar la seguridad y monitorear las acciones del personal.","Realizar una Venta","Proceso de ventas optimizado para transacciones r\xe1pidas y eficientes con actualizaciones de inventario en tiempo real."],t.yf)
